// Updated AccountAnalyzer.tsx - Real API Integration
// Replace your existing AccountAnalyzer.tsx with this version

import React, { useState } from 'react';
import { Search, AlertTriangle, CheckCircle, XCircle, ExternalLink, Instagram, Youtube, Twitter, Loader } from 'lucide-react';
import { socialMediaApi, BotDetectionResult } from '../utils/socialMediaApi';

interface AnalysisState {
  isAnalyzing: boolean;
  result: BotDetectionResult | null;
  error: string | null;
}

export default function AccountAnalyzer() {
  const [username, setUsername] = useState('');
  const [platform, setPlatform] = useState<'instagram' | 'tiktok' | 'youtube' | 'twitter'>('youtube');
  const [accessToken, setAccessToken] = useState('');
  const [showTokenInput, setShowTokenInput] = useState(false);
  const [analysis, setAnalysis] = useState<AnalysisState>({
    isAnalyzing: false,
    result: null,
    error: null
  });

  // YouTube API Key (you'll want to move this to environment variables)
  const YOUTUBE_API_KEY = 'AIzaSyB7h2m40gH1VxEWxcIJbnfO41-fvT73fGg';

  const handleAnalyze = async () => {
    if (!username.trim()) {
      setAnalysis(prev => ({ ...prev, error: 'Please enter a username or channel ID' }));
      return;
    }

    // Validation for different platforms
    if (platform === 'instagram' && !accessToken.trim()) {
      setAnalysis(prev => ({ ...prev, error: 'Instagram access token required' }));
      return;
    }

    if (platform === 'tiktok' && !accessToken.trim()) {
      setAnalysis(prev => ({ ...prev, error: 'TikTok access token required' }));
      return;
    }

    setAnalysis({
      isAnalyzing: true,
      result: null,
      error: null
    });

    try {
      let result: BotDetectionResult;

      switch (platform) {
        case 'instagram':
          result = await socialMediaApi.analyzeInstagramAccount(username.trim(), accessToken.trim());
          break;
        case 'tiktok':
          result = await socialMediaApi.analyzeTikTokAccount(accessToken.trim());
          break;
        case 'youtube':
          // For YouTube, username should be a channel ID
          result = await socialMediaApi.analyzeYouTubeAccount(username.trim(), YOUTUBE_API_KEY);
          break;
        case 'twitter':
          result = await socialMediaApi.analyzeTwitterAccount(username.trim());
          break;
        default:
          throw new Error('Unsupported platform');
      }

      setAnalysis({
        isAnalyzing: false,
        result,
        error: null
      });

    } catch (error) {
      console.error('Analysis error:', error);
      setAnalysis({
        isAnalyzing: false,
        result: null,
        error: error.message || 'Analysis failed'
      });
    }
  };

  const getRiskColor = (riskLevel: string) => {
    switch (riskLevel) {
      case 'LOW': return 'text-green-600 bg-green-50 border-green-200';
      case 'MEDIUM': return 'text-yellow-600 bg-yellow-50 border-yellow-200';
      case 'HIGH': return 'text-orange-600 bg-orange-50 border-orange-200';
      case 'CRITICAL': return 'text-red-600 bg-red-50 border-red-200';
      default: return 'text-gray-600 bg-gray-50 border-gray-200';
    }
  };

  const getRiskIcon = (riskLevel: string) => {
    switch (riskLevel) {
      case 'LOW': return <CheckCircle className="w-5 h-5" />;
      case 'MEDIUM': return <AlertTriangle className="w-5 h-5" />;
      case 'HIGH': return <AlertTriangle className="w-5 h-5" />;
      case 'CRITICAL': return <XCircle className="w-5 h-5" />;
      default: return <AlertTriangle className="w-5 h-5" />;
    }
  };

  const getPlatformIcon = (platformName: string) => {
    switch (platformName) {
      case 'instagram': return <Instagram className="w-5 h-5" />;
      case 'youtube': return <Youtube className="w-5 h-5" />;
      case 'twitter': return <Twitter className="w-5 h-5" />;
      default: return <Search className="w-5 h-5" />;
    }
  };

  const getPlaceholderText = () => {
    switch (platform) {
      case 'youtube': return 'Enter YouTube Channel ID (e.g., UCX6OQ3DkcsbYNE6H8uQQuVA)';
      case 'instagram': return 'Enter Instagram username';
      case 'tiktok': return 'Enter TikTok username';
      case 'twitter': return 'Enter Twitter username';
      default: return 'Enter username';
    }
  };

  const getExampleChannelId = () => {
    return 'UCX6OQ3DkcsbYNE6H8uQQuVA'; // MrBeast's channel
  };

  return (
    <div className="max-w-4xl mx-auto p-6">
      <div className="bg-white rounded-lg shadow-sm border border-gray-200">
        <div className="p-6 border-b border-gray-200">
          <h2 className="text-2xl font-bold text-gray-900 mb-2">Social Media Bot Detection</h2>
          <p className="text-gray-600">
            Analyze social media accounts to detect fake accounts, bots, and suspicious activity patterns.
          </p>
        </div>

        <div className="p-6">
          {/* Platform Selection */}
          <div className="mb-6">
            <label className="block text-sm font-medium text-gray-700 mb-3">
              Select Platform
            </label>
            <div className="grid grid-cols-2 md:grid-cols-4 gap-3">
              {[
                { value: 'youtube', label: 'YouTube', icon: <Youtube className="w-5 h-5" />, available: true, status: '‚úÖ Live API' },
                { value: 'instagram', label: 'Instagram', icon: <Instagram className="w-5 h-5" />, available: false, status: '‚è≥ Pending Approval' },
                { value: 'tiktok', label: 'TikTok', icon: <Search className="w-5 h-5" />, available: false, status: '‚è≥ Pending Approval' },
                { value: 'twitter', label: 'Twitter/X', icon: <Twitter className="w-5 h-5" />, available: false, status: 'üîß Coming Soon' }
              ].map((p) => (
                <div key={p.value} className="relative">
                  <button
                    onClick={() => setPlatform(p.value as any)}
                    disabled={!p.available}
                    className={`
                      w-full flex flex-col items-center gap-2 p-3 rounded-lg border-2 transition-all
                      ${platform === p.value 
                        ? 'border-blue-500 bg-blue-50 text-blue-700' 
                        : p.available 
                          ? 'border-gray-200 hover:border-gray-300 text-gray-700' 
                          : 'border-gray-100 bg-gray-50 text-gray-400 cursor-not-allowed'
                      }
                    `}
                  >
                    {p.icon}
                    <span className="font-medium">{p.label}</span>
                  </button>
                  <div className="text-xs text-center mt-1 text-gray-500">
                    {p.status}
                  </div>
                </div>
              ))}
            </div>
          </div>

          {/* Input Fields */}
          <div className="mb-6">
            <label className="block text-sm font-medium text-gray-700 mb-2">
              {platform === 'youtube' ? 'YouTube Channel ID' : 'Username'}
            </label>
            <div className="relative">
              <input
                type="text"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                placeholder={getPlaceholderText()}
                className="w-full px-4 py-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                disabled={analysis.isAnalyzing}
              />
              {platform === 'youtube' && (
                <button
                  onClick={() => setUsername(getExampleChannelId())}
                  className="absolute right-2 top-1/2 transform -translate-y-1/2 text-sm text-blue-600 hover:text-blue-800"
                >
                  Try MrBeast
                </button>
              )}
            </div>
            {platform === 'youtube' && (
              <p className="text-sm text-gray-500 mt-1">
                üí° To find a YouTube Channel ID: Go to the channel ‚Üí View Page Source ‚Üí Search for "channelId"
              </p>
            )}
          </div>

          {/* Access Token Input for platforms that need it */}
          {(platform === 'instagram' || platform === 'tiktok') && (
            <div className="mb-6">
              <div className="flex items-center justify-between mb-2">
                <label className="block text-sm font-medium text-gray-700">
                  {platform === 'instagram' ? 'Instagram' : 'TikTok'} Access Token
                </label>
                <button
                  onClick={() => setShowTokenInput(!showTokenInput)}
                  className="text-sm text-blue-600 hover:text-blue-800"
                >
                  {showTokenInput ? 'Hide' : 'Show'} Token Input
                </button>
              </div>
              {showTokenInput && (
                <div>
                  <input
                    type="password"
                    value={accessToken}
                    onChange={(e) => setAccessToken(e.target.value)}
                    placeholder={`Enter ${platform} access token...`}
                    className="w-full px-4 py-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                    disabled={analysis.isAnalyzing}
                  />
                  <p className="text-sm text-gray-500 mt-1">
                    ‚ö†Ô∏è {platform === 'instagram' ? 'Instagram' : 'TikTok'} API access pending approval. This will work once approved.
                  </p>
                </div>
              )}
            </div>
          )}

          {/* Analyze Button */}
          <button
            onClick={handleAnalyze}
            disabled={analysis.isAnalyzing || (platform !== 'youtube' && platform !== 'twitter')}
            className="w-full bg-blue-600 text-white py-3 px-4 rounded-lg hover:bg-blue-700 disabled:bg-gray-400 disabled:cursor-not-allowed flex items-center justify-center gap-2 font-medium"
          >
            {analysis.isAnalyzing ? (
              <>
                <Loader className="w-5 h-5 animate-spin" />
                Analyzing {platform} Account...
              </>
            ) : (
              <>
                {getPlatformIcon(platform)}
                Analyze {platform.charAt(0).toUpperCase() + platform.slice(1)} Account
              </>
            )}
          </button>

          {/* Results */}
          {analysis.error && (
            <div className="mt-6 p-4 bg-red-50 border border-red-200 rounded-lg">
              <div className="flex items-center gap-2 text-red-800">
                <XCircle className="w-5 h-5" />
                <span className="font-medium">Analysis Failed</span>
              </div>
              <p className="text-red-700 mt-1">{analysis.error}</p>
            </div>
          )}

          {analysis.result && (
            <div className="mt-6 space-y-4">
              {/* Risk Level */}
              <div className={`p-4 rounded-lg border-2 ${getRiskColor(analysis.result.riskLevel)}`}>
                <div className="flex items-center gap-3 mb-2">
                  {getRiskIcon(analysis.result.riskLevel)}
                  <div>
                    <h3 className="font-bold text-lg">
                      Risk Level: {analysis.result.riskLevel}
                    </h3>
                    <p className="text-sm opacity-75">
                      Bot Probability: {(analysis.result.botProbability * 100).toFixed(1)}%
                    </p>
                  </div>
                </div>
                <p className="font-medium">{analysis.result.recommendation}</p>
              </div>

              {/* Account Info */}
              <div className="bg-gray-50 p-4 rounded-lg">
                <h4 className="font-bold text-gray-900 mb-2">Account Information</h4>
                <div className="grid grid-cols-2 gap-4 text-sm">
                  <div>
                    <span className="text-gray-600">Platform:</span>
                    <span className="ml-2 font-medium">{analysis.result.platform}</span>
                  </div>
                  <div>
                    <span className="text-gray-600">Analyzed:</span>
                    <span className="ml-2 font-medium">
                      {new Date(analysis.result.analysisDate).toLocaleString()}
                    </span>
                  </div>
                </div>
              </div>

              {/* Flags */}
              {analysis.result.flags.length > 0 && (
                <div className="bg-yellow-50 p-4 rounded-lg border border-yellow-200">
                  <h4 className="font-bold text-yellow-800 mb-2">‚ö†Ô∏è Detected Issues</h4>
                  <ul className="space-y-1">
                    {analysis.result.flags.map((flag, index) => (
                      <li key={index} className="text-yellow-700 text-sm">
                        ‚Ä¢ {flag}
                      </li>
                    ))}
                  </ul>
                </div>
              )}

              {/* Analysis Details */}
              <div className="bg-white border border-gray-200 rounded-lg p-4">
                <h4 className="font-bold text-gray-900 mb-3">Analysis Breakdown</h4>
                <div className="grid grid-cols-1 md:grid-cols-3 gap-4 text-sm">
                  <div>
                    <span className="text-gray-600">Profile Analysis:</span>
                    <span className="ml-2 font-medium">
                      {analysis.result.analysis.profileAnalysis.score || 0} points
                    </span>
                  </div>
                  <div>
                    <span className="text-gray-600">Engagement Analysis:</span>
                    <span className="ml-2 font-medium">
                      {analysis.result.analysis.engagementAnalysis.score || 0} points
                    </span>
                  </div>
                  <div>
                    <span className="text-gray-600">Content Analysis:</span>
                    <span className="ml-2 font-medium">
                      {analysis.result.analysis.contentAnalysis.score || 0} points
                    </span>
                  </div>
                </div>
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
}
